let msg = parcel.getFeatureById('welcometxt')

parcel.on('playerenter', event => {
  msg.set({text:"Welcome"})
  feature.set({text:event.name})

  console.log(event.name)
})

parcel.on('playerleave', event => {
  msg.set({text:"Goodbye"})
  feature.set({text:event.name})

  console.log(event.name)
})

var image = parcel.getFeatureById("image");
const urls = [
  "https://opensea.io/assets/0x945520a9f9f9a6a7679ceec5ed28ee19d2ac18b9/2900",
  "https://opensea.io/assets/0x945520a9f9f9a6a7679ceec5ed28ee19d2ac18b9/2901",
  "https://opensea.io/assets/0x945520a9f9f9a6a7679ceec5ed28ee19d2ac18b9/2902",
    "https://opensea.io/assets/0x945520a9f9f9a6a7679ceec5ed28ee19d2ac18b9/2903",
    "https://opensea.io/assets/0x945520a9f9f9a6a7679ceec5ed28ee19d2ac18b9/2904"
]
let setIndex = 0;
feature.on("click", function (e) {
  urls.map((elem, index) => {
    if (elem === image.url) {
      setIndex = index;
    }
  });
  image.set({ url: urls[(setIndex + 1) % urls.length] });
});
